base64string = ''


def base64_to_pixels(base64_string):
    # Remove the data:image/png;base64, header if present
    if ',' in base64_string:
        base64_string = base64_string.split(',', 1)[1]

    # Decode the base64-encoded image data
    image_data = base64.b64decode(base64_string)

    # Load the image data into a PIL Image object
    image = Image.open(BytesIO(image_data))

    # Convert the image to RGBA format
    rgba_image = image.convert('RGBA')

    # Get the pixel data as a list of RGBA tuples
    pixel_data = list(rgba_image.getdata())

    imagewidth, imageheight = image.size

    # show_img(pixel_data, imagewidth, imageheight)

    makeascii(image)

    return pixel_data


def show_img(pixel_data, width, height):
    # Create a new PIL Image object with the given width and height
    image = Image.new('RGBA', (width, height))

    # Set the pixel data on the image
    image.putdata(pixel_data)

    image.show()


chars = 'Ñ@#W$9876543210?!abc;:+=-,._ '[::-1]
charArray = list(chars)
charLength = len(charArray)
interval = charLength/256


def makeascii(im):
    scaleFactor = 0.3

    oneCharWidth = 10
    oneCharHeight = 18

    fnt = ImageFont.truetype('\\lucon.ttf', 15)

    width, height = im.size
    im = im.resize((int(scaleFactor*width), int(scaleFactor *
                   height*(oneCharWidth/oneCharHeight))), Image.NEAREST)
    width, height = im.size
    pix = im.load()

    outputImage = Image.new(
        'RGB', (oneCharWidth * width, oneCharHeight * height), color=(0, 0, 0))

    d = ImageDraw.Draw(outputImage)

    # text_file = open("Output.txt", "w")

    for i in range(height):
        for j in range(width):
            r, g, b, a = pix[j, i]
            h = int(r/3 + g/3 + b/3)
            pix[j, i] = (h, h, h, 255)
            # text_file.write(getChar(h))
            d.text((j*oneCharWidth, i*oneCharHeight),
                   getChar(h), font=fnt, fill=(r, g, b))

        # text_file.write('\n')

    # outputImage.save('output.png')

    im_file = BytesIO()

    outputImage.save(im_file, format='PNG')

    im_bytes = im_file.getvalue()

    im_b64 = base64.b64encode(im_bytes)

    base64result = str(im_b64)[2:-1]

    return base64result


def getChar(inputInt):
    return charArray[math.floor(inputInt*interval)]


